import logo from './logo.svg';
import './App.css';
import React, {useState, useEffect} from 'react';
import Form from 'react-bootstrap/Form';
function App() {
  const [inputValues, setInputValues]= useState({
    age:20,
    sex:1,
    cp:2
  });
  const[isLoading,setLoading]=useState(false)
  const[result,setResult]=useState('Hi')
  const handleChange=(event)=>{
    const {name,value}=event.target;
    setInputValues((prevState)=>{
      return{
        ...prevState,
        [name]:value,
      };
    });
  }

  const handleSubmit=(event)=>{

    const userData=inputValues;

    fetch('/time').then(res=>res.json()).then(data=>{
      setResult(data.time)
    });
    event.preventDefault();
    setLoading=false

  };
  const {age,sex,cp}=inputValues;

  /*useEffect(()=>{
    fetch('/time').then(res=> res.json()).then(data=>{
      setCurrentTime(data.time);
    });
  });
  handleChange=(event)=>{

  }*/
  return (
    <div className="App">
      <header className="App-header">
        <Form>
          <Form.Group className="mb-3" controlId="firstRow">
            <Form.Label>Age</Form.Label><Form.Control type="age" placeholder="Enter Your Age" />
            <Form.Label>Sex</Form.Label><Form.Control type="sex" placeholder="Enter Your Sex" />
          </Form.Group>

        </Form>
        <img src={logo} className="App-logo" alt="logo" />
        <form onSubmit={handleSubmit}>
          <label>Age: <input type="number" name="age" onChange={handleChange} value={age} /></label>
          <label>Sex <input type="number" name="sex" onChange={handleChange} value={sex}/></label>
          <label>Chest Pain Type <input type="number" name="cp" onChange={handleChange} value={cp}/></label>

          <input type="submit" value="Submit" />
        </form>
        <p>{result}</p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
